import React, { Component } from 'react';
import { connect } from 'react-redux'
import { } from '../../../redux/actions/users.js'
import { Container, Segment, Header, Divider, Grid } from 'semantic-ui-react'

class Withdraw extends Component {

  render() {
    return(
      <Container>
        <Segment>
          <Grid columns={2} relaxed='very'>
            <Grid.Column>
              <Header>Account</Header>
            </Grid.Column>
            <Grid.Column>
              <Header>Bank</Header>
            </Grid.Column>
          </Grid>

          <Divider vertical>Deposit</Divider>
        </Segment>
      </Container>
    )
  }
}

export default connect(null, { })(Withdraw);
